import React, { useState } from "react";
import './App.css';

function App() {
  const [name, setName] = useState("");

  return (
    <div className="App">
      <h2>Saisissez un nom dans le champ prévu</h2>

      <form
        action="https://n8n_instance/webhook/aml-verification"
        method="POST"
      >
        <input
          type="text"
          name="Full name"
          placeholder="Entrez un nom"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <button type="submit">Vérifier</button>
      </form>
    </div>
  );
}

export default App;
